function App() {

  return (

    <Router>
      <Routes>
        <Route path='/' element={<PizzaList/>} />
        {/* <Route path='/pizza-detail' element={<PizzaList/>} /> */}
        <Route path='/' element={<PizzaForm/>} />
        <Route path='/search' element={<PizzaResult/>} />
      </Routes>
    </Router>

);

}

export default App;
